def Complement(seq):
    dct={
        "A":"T",
        "T":"A",
        "C":"G",
        "G":"C"
    }

    mer=""

    for char in seq:
        mer= dct[char] + mer

    return mer

if __name__ == "__main__":
    tst = ["CCAGATC","AAAACCCGGT",
    "",
    ]
    def test(tst):
        for t in tst:
            print(t,Complement(t))
    test(tst)
    